import { combineReducers } from 'redux';
import Test from './textReducer';
import Auth from './auth';
import Master from './masterReducer';
import FileUpload from './fileUpload';
import Profile from '../Reducer/profileReducer';
import Gold from './goldData';
import Rate from './goldrate';

export default combineReducers({
    text: Test,
    Auth: Auth,
    master: Master,
    file: FileUpload,
    profile: Profile,
    rate: Rate,
    gold: Gold
});
